import React, { Component } from "react";

class Projects extends Component {
    render() {
        return(
            <div className="condiv projects">
                <h1>Projects</h1>
                <h3>This Website</h3>
                <h4>I wanted a personal website to learn React, centralize my work and to send to potential employers. I followed
                 a tutorial for this website. If you are interested, <a href="https://codeburst.io/learn-react-js-build-a-portfolio-single-page-application-spa-ba001082a711" target="https://codeburst.io/learn-react-js-build-a-portfolio-single-page-application-spa-ba001082a711"> here </a>
                 is a hyperlink and a link to the code is below. <br /><a href="https://github.com/mitchellhoesing/hoesingm_website.io" target="https://github.com/mitchellhoesing/hoesingm_website.io"> https://github.com/mitchellhoesing/hoesingm_website.io </a></h4><br />
                <h3>Project Name</h3>
                <h4>Project Summary <br />Link to Tableau projects</h4><br />
                <h3>Project Name</h3>
                <h4>Project Summary <br />Link to AI projects</h4><br />
            </div>
        )
    }
}

export default Projects
